import React, { useState, useEffect } from 'react';

const AdminSlotServiceTab = () => {
  // Service state
  const [services, setServices] = useState([]);
  const [serviceName, setServiceName] = useState('');

  // Slot state
  const [slots, setSlots] = useState([]);
  const [slotTime, setSlotTime] = useState('');

  // Fetch data on mount
  useEffect(() => {
    fetchServices();
    fetchSlots();
  }, []);

  // ======== SERVICES LOGIC ========
  const fetchServices = async () => {
    try {
      const res = await fetch('http://localhost:5000/api/services');
      const data = await res.json();
      setServices(data);
    } catch (err) {
      console.error('Error fetching services:', err);
    }
  };

  const addService = async () => {
    if (!serviceName.trim()) return;
    try {
      const res = await fetch('http://localhost:5000/api/services', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ name: serviceName }),
      });
      const newService = await res.json();
      setServices([...services, newService]);
      setServiceName('');
    } catch (err) {
      console.error('Error adding service:', err);
    }
  };

  const deleteService = async (id) => {
    try {
      await fetch(`http://localhost:5000/api/services/${id}`, {
        method: 'DELETE',
      });
      setServices(services.filter(s => s.id !== id));
    } catch (err) {
      console.error('Error deleting service:', err);
    }
  };

  // ======== SLOTS LOGIC ========
  const fetchSlots = async () => {
    try {
      const res = await fetch('http://localhost:5000/api/slots');
      const data = await res.json();
      if (Array.isArray(data)) {
        setSlots(data);
      } else {
        console.error('Unexpected data:', data);
        setSlots([]);
      }
    } catch (err) {
      console.error('Error fetching slots:', err);
    }
  };

  const addSlot = async () => {
    if (!slotTime) return;
    try {
      const res = await fetch('http://localhost:5000/api/slots', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ time: slotTime }),
      });
      const newSlot = await res.json();
      setSlots([...slots, newSlot]);
      setSlotTime('');
    } catch (err) {
      console.error('Error adding slot:', err);
    }
  };

  const deleteSlot = async (id) => {
    try {
      await fetch(`http://localhost:5000/api/slots/${id}`, {
        method: 'DELETE',
      });
      setSlots(slots.filter(slot => slot.id !== id));
    } catch (err) {
      console.error('Error deleting slot:', err);
    }
  };

  return (
    <div className="grid grid-cols-1 md:grid-cols-2 gap-8 p-4">
      {/* === Services Section === */}
      <div className="border p-4 rounded shadow">
        <h3 className="text-xl font-semibold mb-4">Manage Services</h3>
        <div className="flex gap-2 mb-4">
          <input
            type="text"
            placeholder="New service name"
            className="border p-2 rounded w-full"
            value={serviceName}
            onChange={(e) => setServiceName(e.target.value)}
          />
          <button onClick={addService} className="bg-blue-600 text-white px-4 py-2 rounded">
            Add
          </button>
        </div>
        <ul>
          {services.map(service => (
            <li key={service.id} className="flex justify-between border-b py-2">
              {service.name}
              <button
                onClick={() => deleteService(service.id)}
                className="text-red-600 hover:underline"
              >
                Delete
              </button>
            </li>
          ))}
        </ul>
      </div>

      {/* === Slots Section === */}
      <div className="border p-4 rounded shadow">
        <h3 className="text-xl font-semibold mb-4">Manage Time Slots</h3>
        <div className="flex gap-2 mb-4">
          <input
            type="time"
            value={slotTime}
            onChange={(e) => setSlotTime(e.target.value)}
            className="border p-2 rounded flex-grow"
          />
          <button onClick={addSlot} className="bg-blue-600 text-white px-4 py-2 rounded">
            Add
          </button>
        </div>
        <ul>
          {slots.map((slot) => (
            <li key={slot.id} className="flex justify-between border-b py-2">
              {slot.time}
              <button
                onClick={() => deleteSlot(slot.id)}
                className="text-red-600 hover:underline"
              >
                Delete
              </button>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default AdminSlotServiceTab;
